BITS 64
CPU X64

%define SYSCALL_EXIT 60
%define SYSCALL_WRITE 1

section .data


prefix: db 1
input: db ""
static input:data

%define input_len 50000

section .text

exit:
static exit:function
  mov rax, SYSCALL_EXIT
  mov rdi, 0
  syscall

write_int_to_stdout:
static write_int:function
  push rbp
  mov rbp, rsp

  sub rsp, 32

  %define ARG0 rdi
  %define N rax
  %define BUF rsi
  %define BUF_LEN r10
  %define BUF_END r9

  lea BUF, [rsp+32]
  mov BUF_LEN, 0
  lea BUF_END, [rsp]
  mov N, ARG0

  .loop:
    mov rcx, 10 ; Divisor.
    mov rdx, 0 ; Reset rem.
    div rcx ; rax /= rcx

    add rdx, '0' ; Convert to ascii.

    ; *(end--) = rem
    dec BUF_END
    mov [BUF_END], dl
    
    inc BUF_LEN

    cmp N, 0
    jnz .loop

  mov rax, SYSCALL_WRITE
  mov rdi, 1
  mov rsi, BUF_END
  mov rdx, BUF_LEN
  syscall


  %undef ARG0
  %undef N
  %undef BUF
  %undef BUF_LEN
  %undef BUF_END

  add rsp, 32
  pop rbp
  ret

solve:
static solve:function
  push rbp
  mov rbp, rsp

  %define INPUT_LEN r10
  %define CURRENT r9
  %define NEXT r11
  %define REMAINING_COUNT rax
  %define END r8

  lea CURRENT, [input] 
  lea NEXT, [input + 1] 
  mov INPUT_LEN, input_len
  mov REMAINING_COUNT, INPUT_LEN
  lea END, [input]
  add END, INPUT_LEN
  

.loop:
  movzx dx, BYTE [CURRENT]
  movzx cx, BYTE [NEXT]
  sub dx, cx
  imul dx, dx

  mov rcx, 32*32

  cmp rdx, rcx
  jnz .else
  .then:
    mov BYTE [CURRENT], 0
    mov BYTE [NEXT], 0

    sub REMAINING_COUNT, 2

    .reverse_search:
    dec CURRENT
    mov dl, [CURRENT]
    cmp dl, 0
    jz .reverse_search


    jmp .endif
  .else:
    mov CURRENT, NEXT
  .endif:

  inc NEXT
  cmp NEXT, END
  jl .loop

  %undef INPUT_LEN
  %undef CURRENT
  %undef NEXT
  %undef REMAINING_COUNT
  %undef END


  pop rbp
  ret

global _start
_start:
  call solve

  mov rdi, rax
  call write_int_to_stdout

  call exit
